//一个滑窗ij 剩下的和为x
//把问题转换成「从 nums\textit{nums}nums 中移除一个最长的子数组，使得剩余元素的和为 xxx」
func minOperations(nums []int, x int) int {
   ans := -1
   sum := 0
   for i:= range nums{
       sum+=nums[i]
   }
   target := sum-x
   if target < 0{
       return -1
   }


   for i := range nums{
       tmp:=0
       j := i
       for j<len(nums) &&tmp < target{
           tmp+=nums[j]
           j++
       }
       if tmp==target{
           ans = maxOf2(ans,j-i)//j-1-i+1
       }
   }
   if ans < 0 {
       return -1
   }
   return len(nums)-ans
}
func maxOf2(a, b int) int {
    if a > b {
        return a
    }
    return b
}
