func minOperations2(nums []int, x int) int {
   ans := -1
   sum := 0
   for i:= range nums{
       sum+=nums[i]
   }
   target := sum-x
   if target < 0{
       return -1
   }

   i,tmp:=0,0
   for j := range nums{
       tmp+=nums[j]
       for tmp > target{
           tmp-=nums[i]
           i++
       }
       if tmp==target{
           ans = maxOf2(ans,j-i)//j-1-i+1
       }
   }
   if ans < 0 {
       return -1
   }
   return len(nums)-ans
}